import React from "react";

function Info(){
    return (
        <div className="info section">
            <div className="infoContainer container">
                <div className="titleDiv flex">
                    <h2>Travel to make memories all around the world</h2>
                </div>
            </div>

        </div>
    )
}

export default Info;
